  const croct = useCroct
  croct.user.edit().set(firstName, 'Mayara').save()
  return <h1></h1>
}
function App() {
  return (
    <CroctProvider appId="00000000-0000-0000-0000-000000000000"> 
    <div>
    <OnBoardingPage name="Mayara"/>
    </div>
    </CroctProvider>
  );
}

export default App;
